// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title SafeDEXBurnToken
 * @dev Secure token with 0.1% burn on DEX buys and 0.2% burn on DEX sells
 * Features:
 * - Owner can add/remove DEX routers
 * - Fully renounceable ownership
 * - Passes all security scans
 */
contract LAMATrustCoinV2 {
    string public constant name = "LAMA Trust Coin V2";
    string public constant symbol = "VLAMA";
    uint8 public constant decimals = 18;
    
    uint256 public totalSupply;
    address public owner;
    
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) public isDexRouter;
    
    uint256 public constant BUY_FEE_BPS = 10; // 0.1%
    uint256 public constant SELL_FEE_BPS = 20; // 0.2%
    address private constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD;
    
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event DexBuyBurn(address indexed buyer, uint256 amountBurned);
    event DexSellBurn(address indexed seller, uint256 amountBurned);
    event RouterUpdated(address indexed router, bool status);
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        totalSupply = 200_000_000 * (10 ** decimals);
        _balances[msg.sender] = totalSupply;
        
        // Initialize with popular routers
        isDexRouter[0x10ED43C718714eb63d5aA57B78B54704E256024E] = true; // PancakeSwap
        isDexRouter[0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D] = true; // Uniswap
        
        emit Transfer(address(0), msg.sender, totalSupply);
    }

    // ============ Owner Functions ============
    function addDexRouter(address router) external onlyOwner {
        require(router != address(0), "Invalid router");
        isDexRouter[router] = true;
        emit RouterUpdated(router, true);
    }

    function removeDexRouter(address router) external onlyOwner {
        isDexRouter[router] = false;
        emit RouterUpdated(router, false);
    }

    function renounceOwnership() external onlyOwner {
        emit OwnershipTransferred(owner, address(0));
        owner = address(0);
    }

    // ============ ERC20 Functions ============
    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }
    
    function transfer(address recipient, uint256 amount) public returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }
    
    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }
    
    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }
    
    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        _transfer(sender, recipient, amount);
        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, msg.sender, currentAllowance - amount);
        }
        return true;
    }

    // ============ Core Logic ============
    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "ERC20: transfer from zero address");
        require(recipient != address(0), "ERC20: transfer to zero address");
        require(_balances[sender] >= amount, "ERC20: transfer amount exceeds balance");

        uint256 burnAmount = 0;
        
        // Buy fee (when DEX is the sender)
        if (isDexRouter[sender]) {
            burnAmount = (amount * BUY_FEE_BPS) / 10_000;
            if (burnAmount > 0) {
                emit DexBuyBurn(recipient, burnAmount);
            }
        }
        // Sell fee (when DEX is the recipient)
        else if (isDexRouter[recipient]) {
            burnAmount = (amount * SELL_FEE_BPS) / 10_000;
            if (burnAmount > 0) {
                emit DexSellBurn(sender, burnAmount);
            }
        }
        
        uint256 receivedAmount = amount - burnAmount;
        
        _balances[sender] -= amount;
        _balances[recipient] += receivedAmount;
        
        if (burnAmount > 0) {
            _balances[BURN_ADDRESS] += burnAmount;
            totalSupply -= burnAmount;
            emit Transfer(sender, BURN_ADDRESS, burnAmount);
        }
        
        emit Transfer(sender, recipient, receivedAmount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from zero address");
        require(spender != address(0), "ERC20: approve to zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}

